const Pokemon = ({ pokemon }) => {
    const { spirites } = pokemon
    Object.keys(spirites).forEach(key => {
        return [key, pokemon.sprites[key]]
    })

    console.log(sprites)

    return (
        <div>
            Pokemon
        </div>
    )
}

export default Pokemon
